// pages/Profile/index.js

import React, { useState } from 'react';
import { useLocation } from 'react-router-dom';
import BottomBar from '../../components/BottomBar';

export default function Profile() {
  const location = useLocation();
  const { username, firstName, lastName } = location.state || {};

  const [profileUsername, setProfileUsername] = useState(username || '');
  const [profileFirstName, setProfileFirstName] = useState(firstName || '');
  const [profileLastName, setProfileLastName] = useState(lastName || '');

  const handleUsernameChange = (e) => {
    setProfileUsername(e.target.value);
  };

  const handleFirstNameChange = (e) => {
    setProfileFirstName(e.target.value);
  };

  const handleLastNameChange = (e) => {
    setProfileLastName(e.target.value);
  };

  return (
    <div>
      <h3>Profile</h3>
      <form>
        <label>
          Username:
          <input type="text" value={profileUsername} onChange={handleUsernameChange} />
        </label>
        <br />
        <label>
          First Name:
          <input type="text" value={profileFirstName} onChange={handleFirstNameChange} />
        </label>
        <br />
        <label>
          Last Name:
          <input type="text" value={profileLastName} onChange={handleLastNameChange} />
        </label>
      </form>
      <BottomBar />
    </div>
  );
}
